import React from "react";
import { useState, useEffect } from 'react'
import '../styles/sections/Affiliateprofile.css'
import axios from 'axios'
import { useSignIn } from 'react-auth-kit'
import axiox from 'axios'


function Affiliateprofile(props) {

    useEffect(() => {
        axios.get(`http://localhost:3000/api/global/getprofile`, {
            params: {
                email: props.user
            }
        }).then((res) => {
            console.log(res.data.user_profile)
        }).catch(err => alert(err))
    }, [])

    const signIn = useSignIn
    const date = new Date()

    const [profile, setProfile] = useState("https://scontent.fcrk3-1.fna.fbcdn.net/v/t39.30808-6/287825759_2021439201389784_2663061212977595522_n.jpg?_nc_cat=107&ccb=1-7&_nc_sid=09cbfe&_nc_eui2=AeHUOJ5Eto2mDxJzXVLYrCo8TKcasVkT5iFMpxqxWRPmIS40rxjS9EcXcWTf1Fv3BbTrENl_1B-rhwXR01nUZPPa&_nc_ohc=BZh9bqrQ96QAX_lcXHa&_nc_ht=scontent.fcrk3-1.fna&oh=00_AfAJpu-3XXM_bTOKiegLt0umNgTR1a3m8_Fs1uHlXLGrPA&oe=64A96412")
    const [firstname, setFirstname] = useState("auth().first_name");
    const [lastname, setLastname] = useState("().last_nameauth");
    const [email, setEmail] = useState("auth().email");
    const [birthdate, setBirthdate] = useState("auth().birthdate ? date : ");
    const [province, setProvince] = useState("auth().province ? auth().province : ");
    const [country, setCountry] = useState("auth().country ? auth().country : ");
    const [editview, setEditview] = useState(false)

    const handleDiscard = (event) => {
        event.preventDefault()
        setEditview(false)
    }

    const updateAffiliate = (event) => {
        event.preventDefault()
        axios.post(`http://localhost:3000/api/affiliate/update`, {
            email: props.user,
            birthdate: birthdate,
            firstname: firstname,
            lastname: lastname,
            province: province,
            country: country
        }).then((res) => {
            console.log(res.data)
            setEditview(false)
            signIn({
                authState: res.data.user_profile,
            })
        }).catch(err => console.log(err))
    }

    return (
        <div className="affiliateprofile-container">
            <div className="affiliateprofile-info-container">
                <div className="affiliateprofile-info-block">
                    <img alt="profile" className="affiliateprofile-info-image" src={profile}></img>
                    <div className="affiliateprofile-info-data">
                        <form onSubmit={updateAffiliate} className='affiliate-landingpage-form-container'>
                            <div className='affiliate-landingpage-two-fields'>
                                <div className='affiliate-landingpage-field'>
                                    <label htmlFor='affiliate-register-firstname'>First Name:</label>
                                    {editview ? <input onChange={(e) => { setFirstname(e.target.value) }} type="text" placeholder={firstname}></input> : firstname}
                                </div>
                                <div className='affiliate-landingpage-field'>
                                    <label htmlFor='affiliate-register-lastname'>Last Name:</label>
                                    {editview ? <input onChange={(e) => { setLastname(e.target.value) }} type="text" placeholder={lastname}></input> : lastname}
                                </div>
                            </div>
                            <div className='affiliate-landingpage-two-fields'>
                                <div className='affiliate-landingpage-field'>
                                    <label htmlFor='affiliate-register-firstname'>Email:</label>
                                    {email}
                                </div>
                                <div className='affiliate-landingpage-field'>
                                    <label htmlFor='affiliate-register-lastname'>birthday:</label>
                                    {editview ? <input placeholder={birthdate} onChange={(e) => { setBirthdate(e.target.value) }} type="date" placeholder={birthdate}></input> : birthdate}
                                </div>
                            </div>
                            <div className='affiliate-landingpage-two-fields'>
                                <div className='affiliate-landingpage-field'>
                                    <label htmlFor='affiliate-register-firstname'>Province:</label>
                                    {editview ? <input onChange={(e) => { setProvince(e.target.value) }} type="text" placeholder={province}></input> : province}
                                </div>
                                <div className='affiliate-landingpage-field'>
                                    <label htmlFor='affiliate-register-lastname'>Country:</label>
                                    {editview ? <input onChange={(e) => { setCountry(e.target.value) }} type="text" placeholder={country}></input> : country}
                                </div>
                            </div>
                            {!editview && (<button onClick={() => { setEditview(true) }} >Edit</button>)}
                            {editview && (<button onClick={handleDiscard}>Discard</button>)}
                            {editview && (<button type="submit">Submit</button>)}
                        </form>
                    </div>
                </div>

            </div>
        </div>
    );
}

export default Affiliateprofile
